
public class NestedLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		for(int a=1;a<=5;a++)  // Outer loop runs for 5 times
		{
			System.out.println("am started");
			for(int b=1;b<=5;b++)
			{
				System.out.println("on the way");
			}
			System.out.println("am n home");
		}
		

		
	}

}
